/** @format */

import React from "react";
import { TitleBlock, Thumbnail, TitleBox } from "./StyleTitleCard";
import { StarFilled } from "@ant-design/icons";
const TitleCard = () => {
  return (
    <>
      <TitleBlock>
        <Thumbnail />
        <TitleBox>
          <h2>닭치Go</h2>
          <p>
            <StarFilled style={{ color: "#ffeaa7" }} />
            (리뷰개수) · 거리 · 원
          </p>
        </TitleBox>
      </TitleBlock>
    </>
  );
};

export default TitleCard;
